import React from "react";
import Button from "../../components/Button";
import styles from "./notMail.module.scss";
import { Link } from "react-router-dom";

const Confirm = () => {
  return (
    <div className={styles.container}>
      <h1>Мне не пришло письмо</h1>
      <h2>
        Письмо может прийти с задержкой в 5-10 минут.
        <br />
        Также проверьте разные папки почтового ящика (актуально для gmail.com) и
        папку "Спам".Если письмо все же не пришло, повторите попытку или
        напишите об этом в тех.поддержку support@livedune.ru и мы активируем ваш
        аккаунт.
      </h2>
      <div className={styles.mail_btnWrapper}>
        <Link to="/not_mail">
          <Button>Перейти к почте</Button>{" "}
        </Link>
      </div>

      <h3>Мне не пришло письмо</h3>
    </div>
  );
};
export default Confirm;
